        <div className="p-circle"></div> */} 
      
      
          <h4 className="h4">JS fetch App</h4>
      <a href='https://mayenge.github.io/simbafetch' target="_blank" rel="noreferrer">
        <img src={fetch} alt="" className="p-img" />
      </a>
      
      
    </div>
    
  );
};

export default Product;
